INSERT INTO `map_app_orgs` VALUES (1,'leuze','ACC1','https://www.leuze.com','+49 7021 573-0','','+49 7021 573-199','','','','info@leuze.com','','','Laser Sensor Manufacturer','','','','','','','','','','','','In der Braike 1','','Owen','','','','73277','','Deutschland','','In der Braike 1, 73277 Owen, Deutschland',48.583444148143700,9.446941853971510,'','','A successful example of practical experience orientation\r\nWhen the decision was made in the early 60s to found Leuze electronic that would develop sensors for the company\'s textile machines, we didn\'t expect that it would develop into the successful international company that it is today.\r\n\r\nToday, it is a worldwide success story and stands for forward-thinking entrepreneurship as only few companies do. It\'s no accident that today Leuze electronic is considered a technology driver and is active in all growing markets with subsidiaries and a variety of distributors all over the world.','2021-03-27','2021-04-11','',1,44,8,0,313,'17','https://www.leuze-shop.com/en/shop/metaseiten/ueber_leuze_electronic_1.php','Leuze electronic GmbH + Co. KG',''),(2,'akusense','ACC2','http://www.akusense.com/','86-755-23337227','','86-755-27920807','','','','info@akusense.com','','','Laser Sensor Manufacturer','','','','','','','','','','','','ShenZhen Factory address Address: 6th Floor, Building A, Xinhui Industrial Zone, Tangtou Third Industrial Park,Shiyan Street, Baoâan District, Shenzhen','','Shenzhen','','','','518000','','China','','6th Floor, Building A, Xinhui Industrial Park, Tangtou Third Industrial Zone, Baoan District, Shenzhen, China',32.647500000000000,110.778060000000000,'','','AkuSense is a leading sensor application solution provider with full design and manufacturing capabilities. AkuSense is also a high-tech enterprise as listed by the Chinese government. AkuSense was established in 2010 in Shenzhen, the \"China Silicon Valley\". AkuSense has two (2) product development teams with one in Shenzhen China and the other one in Seattle USA. Team members are experienced sensor designers lead by an US sensor expert with 30 years of experience in sensor design innovation and providing solution to meet customer\'s needs.\r\n\r\nAkuSense\'s technical expertises are in the following sensing technologies: Photoelectric, Inductive, Hall, Capacitive, Laser, Ultrasonic, Milimeter Waveï¼Pressure Film and wireless communication in industrial products. From the beginning technical feasibility assessment to manufacturing and quality control, AkuSense is confident that we can meet your requirements and we can help you in gaining your competitiveness.\r\n\r\nAkuSense welcomes OEM/ODM projects','2021-03-27','2021-04-11','',1,14,2,0,255,'5','http://www.akusense.com/p_page.htm','AkuSense (Shenzhen AkuSense Technology Co.,Ltd)',''),(3,'balluff','ACC3','https://www.balluff.com/local/de/home/','0049 7158 173-0','','0049 7158 5010','','','','balluff@balluff.de','','','Laser Sensor Manufacturer','','','','','','','','','','','','SchurwaldstraÃe 9','','Neuhausen a.d.F.','','','','73765','','Deutschland','','SchurwaldstraÃe 9, 73765 Neuhausen auf den Fildern, Allemagne',48.690012929684100,9.269531084657170,'','','Automate, innovate, celebrate a century of Balluff!\r\nWe are proud of what we have achieved. We are excited about everything that is yet to come. As an automation specialist, we have launched numerous innovations. And we are not standing still. We want to actively shape the future of digitalization and the Industrial Internet of Things, with our global team and with you.\r\nWith our anniversary website, we want to take you on our journey through time. Here numerous stories are told about our milestones, contemporary witnesses have their say, and current projects, employees and locations are presented. We also look ahead to the future and, together with industry experts, take a stand on important topics of the future.','2021-03-27','2021-04-11','',1,44,3,0,313,'6','https://www.balluff.com/en/de/company/100-years-balluff/','Balluff GmbH',''),(4,'banner','ACC4','https://www.bannerengineering.com/','1-888-3 (736767)','','','','','','info@bannerengineering.com','','','Laser Sensor Manufacturer','','','','','','','','','','','','9714 Tenth Avenue North','','Minneapolis','','','','MN 55441','','USA','','9714 10th Ave N, Plymouth, MN 55441, USA',44.990577970814400,-93.403353530685700,'','','Who We Are: Company Overview\r\nEvery 3.5 seconds, a Banner sensor is installed somewhere in the world. Banner solves problems for most of the manufacturing companies in the Fortune 500, as well as the startups changing industry with leading-edge production. Banner technology supports manufacturing of the cars you drive, the food you eat, the medicine you take, and virtually every product in your daily life. Whatever the industry, Banner offers solutions to automate production, improve efficiency, and manufacture to the highest standard of quality.','2021-03-27','2021-04-11','',1,2,4,0,228,'7','https://www.bannerengineering.com/us/en/company/overview.html','Banner Engineering Corp.',''),(5,'dadisick','ACC5','https://www.dadisick.com/','0086-13713346108','','','','','','linjiancheng@mall.dadisick.net','lucyyan@mall.dadisick.net','','Laser Sensor Manufacturer','','','','','','Sales Manager: Lucy Yan','','','','','','No.7 Sanjiang Industrial Area, Hengli Town, Dongguan City, Guangdong Province P.R.China','','Dongguan City','','','','523000','','China','','No.7 Sanjiang Industrial Area, Hengli Town, Dongguan City, Guangdong Province P.R.China.',23.048890000000000,113.744720000000000,'','','Our History\r\n\r\nDongguan Dadi Electronic Technology Co., Ltd. is a leading manufacturer of safety light curtains and infrared sensors. We are one of the first companies to enter the national optoelectronic high-tech industry. Since its establishment in 2003, we have had more than 15 years of production experience. We are committed to producing equipment that protects the safety of machine operators. Providing quality products and professional services for well-known enterprises and customers in the industry. It is a Chinese-made sensor that can replace Omron, Keynes, Contrinex and other brands.','2021-03-27','2021-04-11','',1,2,5,0,255,'8','https://www.dadisick.com/about-us','Dongguan DADI Electronic Technology Co.,Ltd.',''),(6,'di-soric','ACC6','https://www.di-soric.com/','0049 7181 98 79-0','','','','','','info@di-soric.com','','','Laser Sensor Manufacturer','','','','','','','','','','','','Steinbeisstrasse 6','','Urbach','','','','73660','','Deutschland','','SteinbeisstraÃe 6, 73660 Urbach, Allemagne',48.809045995809000,9.564898253971510,'','','We love the challenges presented to us by our customers. As an automation partner who speaks your language, we want to help you design your industrial applications so that they are more efficient and process-reliable â anything from simple standard applications to complex customer-specific solutions.\r\nWhether it\'s sensor systems, image processing, safety technology or machine and signal lighting, our wide-ranging technical expertise offers the ideal foundation for this. That is why we are consistently further developing our existing products and striving to create new, innovative products in line with our brand promise \"Solutions. Clever. Practical.\"\r\nWe consider sustainable thinking and action for the world of tomorrow and a healthy workplace environment as our company responsibility and these are always an important component of our decision-making processes.','2021-03-27','2021-04-10','',1,2,16,0,313,'2','https://www.di-soric.com/Company/About-us','di-soric GmbH & Co. KG .',''),(7,'hokuyo','ACC7','https://www.hokuyo-aut.jp/','0081-6-6441-2239','','0081-6-6441-2204','','','','info@hokuyo-aut.jp','','','Laser Sensor Manufacturer','','','','','','','','','','','','Higobashi Union Building, 1-9-6 Edobori, Nishi-ku Osaka-shi, Osaka 550-0002 Japan','','Nishi-ku Osaka-shi','','','','550-0002','','Japan','','Higobashi Union Building, 1-9-6 Edobori, Nishi-ku Osaka-shi, Osaka 550-0002 Japan',34.688800000000000,135.493400000000000,'','','Who we are\r\nHOKUYO, founded in Osaka, Japan in 1946, developed and continues to offer some of the original automation technology with products such as counters, photoelectric sensors and Automatic doors for a wide range of factory automation systems and various production processes.\r\nFor many years we have been developing several types of products for factory automation that include high-accuracy CCD sensors and optical data transmission devices and maintain an outstanding reputation for our creativity and performance with customers.\r\n\r\nHOKUYO products are integrated into many industrial sectors such as textiles, electric wire, iron & steel, transportation systems, mounting machines, semiconductor and LCD facilities. They have contributed to the growth and development of these industries.\r\n\r\nWith the fast-paced changes in information technology, industrial globalization and despite the environmental and safety uncertainties we face in the world today, Hokuyo will adapt and continue to thrive as a leader and continue to pursue its growth with great efficiency.\r\n\r\nAs a pioneer of automation technology, Hokuyo will be sensitive and proactive to the needs of customers and pursue the challenges ahead to offer the best product solutions in the future.\r\n\r\nHokuyo looks forward to your continued business in the future.','2021-03-27','2021-04-11','',1,6,6,0,113,'9','https://www.hokuyo-aut.jp/company/','HOKUYO',''),(8,'ifm','ACC8','https://www.ifm.com/','0049 201 24 22 0','','0800 16 16 16 4','','','','info@ifm.com','','','Laser Sensor Manufacturer','','','','','','','','','','','','FriedrichstraÃe 1','','','','','','D-45128 Essen','','Deutschland','','FriedrichstraÃe 1, 45128 Essen, Deutschland',51.444336060806400,7.006265584657170,'','','At the beginning it was passion driving the founders to make it better. To develop sensors with extraordinary quality and reliability and to provide unequalled customer service. It was with this vision and knowing that \'quality\' by far exceeds the actual product that ifm started in October 1969.','2021-03-27','2021-04-11','',1,2,17,0,313,'10','https://www.ifm.com/au/en/au/company/about-us-au','ifm electronic gmbh',''),(9,'labano','ACC9','http://www.lanbaosensor.com/','0086-21-57486188-8066','','0086-57486199','','','','Mailboxmarket@shlanbao.cn','export@shlanbao.cn','','Laser Sensor Manufacturer','','','','','','','','','','','','228 Jinbi Road, Jinhui Industrial Park, Fengxian District','','Shanghai','','','','201404','','China','','No. 228 Jinbi Road, Jinhui Industrial Park, Fengxian District, Shanghai, China',30.928350000000000,121.582210000000000,'','','Supplier for sensor and industrial measurement & control solutions\r\n\r\nShanghai Lanbao Sensing Technology Co., Ltd. was founded in 1998 and is headquartered in Shanghai, China. The company\'s main business is around the development, production, sales and application of industrial measurement and control sensors, providing customers with standardized and customized industrial measurement and control sensors and industrial measurement and control sensing systems. The business is spread all over the world, business contacts in 50 countries and regions, and the technical performance of each product is in the leading position in the industry, among which many series of products have reached the international advanced level.','2021-03-27','2021-04-11','',1,2,7,0,255,'11','http://www.lanbaosensor.com/profile/','Labano',''),(10,'wenglor','ACC10','https://www.wenglor.com/','0049 (0)7542 5399-0','','0049 (0)7542 5399-988','','','','info@wenglor.com','','','Laser Sensor Manufacturer','','','','','','','','','','','','wenglor StraÃe 3','','Tettnang','','','','88069','','Deutschland','','Wenglor StraÃe 3, 88069 Tettnang, Allemagne',47.660597095619400,9.598217615342830,'','','Get to Know wenglor in All Dimensions\r\nWe provide you with an introduction to the company, keep you up-to-date in the press area and offer you insights into our lively past. We also show you at which worldwide locations youâll met up with us at a trade fair, and what the innovative family has in common with competition sports.','2021-03-27','2021-04-10','',1,82,25,0,313,'3','https://www.wenglor.com/about-wenglor/','wenglor sensoric GmbH',''),(11,'sick','ACC11','https://www.sick.com/','0049 7681 202-0','','0049 7681 202-3863','','','','info@sick.com','','','Laser Sensor Manufacturer','','','','','','Dr. Robert Bauer (Vorsitzender des Vorstands)','','','','','','Erwin-Sick-Str. 1','','Waldkirch','','','','79183','','Deutschland','','Erwin-Sick-StraÃe 1, 79183 Waldkirch, Allemagne',48.088058007157400,7.948132600000000,'','','From factory automation to logistics automation and process automation, SICKâs sensor solutions are keeping industry moving. As a technology and market leader, SICK provides sensor intelligence and application solutions that create the perfect basis for controlling processes securely and efficiently, protecting individuals from accidents, and preventing damage to the environment.','2021-03-27','2021-04-10','',1,80,14,0,313,'1','https://www.sick.com/de/en/about-sick/w/about-sick/','SICK AG',''),(12,'sdkeli','ACC12','https://www.sdkelien.com/','86-0537-2168110','','86-0537-2331667','','','','sale@sdkeli.com','','','Laser Sensor Manufacturer','','','','','','','','','','','','A3 Building, Industrial & Education & Research Base of Jining High-Tech Zone','','Jining, Shandong','','','','272000','','China','','A3 Building, Industrial & Education & Research Base of Jining High-Tech Zone, Jining, Shandong, China',35.405000000000000,116.581390000000000,'','','Jining KeLi Photoelectronic Industrial Co.,Ltd. belongs to Laser Research Institute of Shandong Academy of Sciences. We dedicated to research, promotion and application of photoelectronic protecting technology since 1990s. SDKELI is a professional manufacturer of photoelectronic safety protection products, and the leader of photoelectronic safety technology in China. It is the leader unit of Electro-sensitive Equipment of National Technical Committee on Electrical Systems of Industrial Machinery of Standardization Administration. And SDKELI is the standard drafting team of GB4584-2007, GB/T19436.1, and GB/T19436.2. It is Shandong Technology Research Center for Photoelectronic Detection Security Control Project. Leading products include photoelectric safety devices (safety light curtains), safety relay modules and Laser Safety Devices for bending machine, which are mainly used in metal forming machinery, pressure machines and bending machines to protect personal safety. Our products have been listed as the excellent promotion program of work safety scientific and technological achievements by State Administration of Work Safety. Our quality system had been certified to ISO9001:1994 in 1998 and ISO9001:2008 in 2010. KS06 photoelectric safety devices have been awarded Safety Certificate IV, T4 series security light curtains have been certified to EU TUV, and laser safety devices for bending machine have been certified to SAFENET Safety IV Certification. [Safety Maintenance, Improvement, Customer Satisfaction, Success by Quality\" is the quality policy that the company pursues all the time, we will strive to provide more excellent products and quality services for customers.\r\nVisit My Factory','2021-03-27','2021-04-11','',1,2,15,0,255,'12','https://www.sdkelien.com/jining-keli-photoelectronic-industrial-co-ltd.html','Sdekli Jining KeLi Photoelectronic Industrial Co.,Ltd',''),(13,'rockwell','ACC13','https://www.rockwellautomation.com/','+18005523589','','','','','','info@ra.rockwell.com','','','Laser Sensor Manufacturer','','','','','','','','','','','','1201 South Second Street','','Milwaukee, Wisconsin','','','','53204-2410','','USA','','1201 S 2nd St, Milwaukee, WI 53204, USA',43.018668447114500,-87.913595615448600,'','','Our mission is to improve the quality of life by making the world more productive and sustainable. We are committed to enabling the next generation of smart manufacturing. With the right strategy, talented people, and our substantial financial strength, we are dedicated to deliver value to our customers.\r\n\r\nWhen you invest in Rockwell Automation technology and solutions, you invest in the future of manufacturing.','2021-03-27','2021-04-11','',1,2,13,0,228,'13','https://www.rockwellautomation.com/en-us/company/about-us.html','Rockwell',''),(14,'reer','ACC14','https://www.reersafety.com/','0039 011 248 22 15','','0039 011 85 98 67','','','','reer@pecsoci.ui.torino.it','info@reer.it','','Laser Sensor Manufacturer','','','','','','','','','','','','Corso Re Umberto 2','','Torino','','','','10121','','Italy','','Corso Re Umberto 2 â 10121 Torino, Italy',45.067854505618100,7.675714911521410,'','','ReeR was established in 1959 to distribute components for industry, lighting and home automation.\r\n\r\nBy the mid-70âs the first safety sensors were developed, and afterwards the first light curtains were produced.\r\n\r\nToday ReeR is both the Italian leading company and one of the main world manufacturers of optoelectronic sensors for industrial safety.\r\nThe export activity of the Safety Division outlines the companyâs global expertise and its network of skilled distributors provide an accurate support service to their customers based in more than 60 countries.','2021-03-27','2021-04-11','',1,132,12,0,325,'4','https://www.reersafety.com/us/en/reer/about-us','ReeR SpA',''),(15,'pilz','ACC15','https://www.pilz.com/de-DE','0049 711 3409-0','','','','','','pilz.gmbh@pilz.de','info@pilz.de','','Laser Sensor Manufacturer','','','','','','','','','','','','Felix-Wankel-StraÃe 2','','Ostfildern','','','','73760','','Deutschland','','Felix-Wankel-StraÃe 2, 73760 Ostfildern, Deutschland',48.713285101809600,9.308183300000000,'','','Pilz offers complete automation solutions based around its core skill of safety â from sensor technology to control and actuator technology. The product range is being expanded to include corresponding software tools, diagnostic and visualisation systems as well as services. So complete system solutions emerge. Complete also means that our solutions consist both of automation solutions and safety solutions. To do this, we merge safety and automation into one solution.\r\n\r\nPilz solutions can be used in all areas of mechanical engineering, including the packaging and automotive industry, robot applications, plus the wind energy and railway technology sectors. These solutions guarantee that baggage handling systems run safely at airports, that theatre scenery moves smoothly and funiculars or roller coasters travel safely.','2021-03-27','2021-04-11','',1,116,11,0,313,'14','https://www.pilz.com/en-INT/company/company-profile','Pilz GmbH & Co. KG',''),(16,'pepperl-fuchs','ACC16','https://www.pepperl-fuchs.com/','0049 621 776 - 0','','0049 621 776 - 1000','','','','info@de.pepperl-fuchs.com','','','Laser Sensor Manufacturer','','','','','','Gunther Kegel, Ph.D (Chairman)','','','','','','LilienthalstraÃe 200','','Mannheim','','','','68307','','Deutschland','','LilienthalstraÃe 200, 68307 Mannheim, Deutschland',49.545792816091800,8.468007160828100,'','','Automation is our world. Perfect application solutions are our goal.\r\nIn 1945, Walter Pepperl and Ludwig Fuchs founded a small radio workshop in Mannheim, Germany, based on the principles of inventiveness, entrepreneurial foresight, and self-reliance. The experience they acquired was transformed into new ideas, and they continued to enjoy developing products for customers. The eventual result was the invention of the proximity switch. This innovation represented the starting point of the company\'s success story.\r\n\r\nToday, Pepperl+Fuchs is known by customers around the world as a pioneer and an inn